import React from 'react';
import { 
  Container, 
  Typography, 
  Button, 
  Grid, 
  Card, 
  CardContent, 
  CardMedia, 
  styled,
  Box
} from '@mui/material';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import ExploreIcon from '@mui/icons-material/Explore';
import FlightTakeoffIcon from '@mui/icons-material/FlightTakeoff';
import HotelIcon from '@mui/icons-material/Hotel';

const HeroSection = styled('div')(({ theme }) => ({
  height: '80vh',
  backgroundImage: 'url(https://source.unsplash.com/1600x900/?travel,landscape)',
  backgroundSize: 'cover',
  backgroundPosition: 'center',
  backgroundAttachment: 'fixed', // Parallax effect
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  color: 'white',
  textAlign: 'center',
  position: 'relative',
  '&::before': {
    content: '""',
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: 'rgba(0,0,0,0.4)',
  },
}));

const HeroContent = styled(motion.div)(({ theme }) => ({
  position: 'relative',
  zIndex: 1,
  padding: theme.spacing(3),
  borderRadius: theme.spacing(2),
  backdropFilter: 'blur(8px)',
  backgroundColor: 'rgba(255, 255, 255, 0.1)',
}));

const StyledCard = styled(motion(Card))(({ theme }) => ({
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  transition: 'transform 0.3s ease-in-out',
  '&:hover': {
    transform: 'translateY(-10px)',
    boxShadow: theme.shadows[10],
  },
}));

const StyledSection = styled('div')(({ theme }) => ({
  padding: theme.spacing(10, 0),
  backgroundColor: theme.palette.background.default,
}));

const AnimatedButton = styled(motion(Button))(({ theme }) => ({
  marginTop: theme.spacing(4),
  padding: theme.spacing(1.5, 4),
  borderRadius: 30,
  fontSize: '1.1rem',
  '&:hover': {
    transform: 'scale(1.05)',
  },
}));

function Home() {
  const features = [
    {
      title: 'Discover Places',
      description: 'Find amazing destinations and attractions worldwide.',
      image: 'https://source.unsplash.com/400x300/?destination,travel',
      icon: <ExploreIcon fontSize="large" />,
    },
    {
      title: 'Plan Itineraries',
      description: 'Create detailed travel plans with our easy-to-use tools.',
      image: 'https://source.unsplash.com/400x300/?planning,map',
      icon: <FlightTakeoffIcon fontSize="large" />,
    },
    {
      title: 'Book Hotels',
      description: 'Find and book the perfect accommodation for your stay.',
      image: 'https://source.unsplash.com/400x300/?hotel,luxury',
      icon: <HotelIcon fontSize="large" />,
    },
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.3,
      },
    },
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
    },
  };

  return (
    <Box>
      <HeroSection>
        <HeroContent
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <Container maxWidth="md">
            <Typography 
              variant="h1" 
              component={motion.h1}
              initial={{ opacity: 0, y: -20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 0.3 }}
              sx={{ 
                fontSize: { xs: '2.5rem', md: '4rem' },
                fontWeight: 'bold',
                marginBottom: 2
              }}
            >
              Plan Your Perfect Trip
            </Typography>
            <Typography 
              variant="h5" 
              paragraph
              component={motion.p}
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 0.5 }}
            >
              Discover amazing destinations and create unforgettable memories
            </Typography>
            <AnimatedButton
              component={Link}
              to="/search"
              variant="contained"
              color="primary"
              size="large"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              Start Planning
            </AnimatedButton>
          </Container>
        </HeroContent>
      </HeroSection>

      <StyledSection>
        <Container maxWidth="lg">
          <motion.div
            variants={containerVariants}
            initial="hidden"
            whileInView="visible"
            viewport={{ once: true }}
          >
            <Typography 
              variant="h3" 
              align="center" 
              gutterBottom
              sx={{ 
                fontWeight: 'bold',
                marginBottom: 6
              }}
            >
              Why Choose Us?
            </Typography>
            <Grid container spacing={4}>
              {features.map((feature, index) => (
                <Grid item key={feature.title} xs={12} sm={6} md={4}>
                  <motion.div variants={itemVariants}>
                    <StyledCard>
                      <CardMedia
                        component="img"
                        height="240"
                        image={feature.image}
                        alt={feature.title}
                      />
                      <CardContent sx={{ textAlign: 'center' }}>
                        <Box sx={{ marginBottom: 2, color: 'primary.main' }}>
                          {feature.icon}
                        </Box>
                        <Typography 
                          gutterBottom 
                          variant="h5" 
                          component="h2"
                          sx={{ fontWeight: 'bold' }}
                        >
                          {feature.title}
                        </Typography>
                        <Typography variant="body1" color="text.secondary">
                          {feature.description}
                        </Typography>
                      </CardContent>
                    </StyledCard>
                  </motion.div>
                </Grid>
              ))}
            </Grid>
          </motion.div>
        </Container>
      </StyledSection>
    </Box>
  );
}

export default Home;
